import { Module, OnModuleInit } from '@nestjs/common';
import { InjectRepository, TypeOrmModule } from '@nestjs/typeorm';
import { Repository } from 'typeorm';
import * as bcrypt from 'bcryptjs';
import * as fs from 'node:fs';
import * as path from 'node:path';
import { AuthModule } from './auth/auth.module';
import { UsersModule } from './users/users.module';
import { ClaimsModule } from './claims/claims.module';
import { ConfigModule } from './config/config.module';
import { GrpcModule } from './grpc/grpc.module';
import { User, UserRole } from './users/entities/user.entity';
import { Claim } from './claims/entities/claim.entity';
import { Config } from './config/entities/config.entity';
import { Tenant } from './tenants/entities/tenant.entity';
import { TenantsModule } from './tenants/tenants.module';

@Module({
  imports: [
    TypeOrmModule.forRoot({
      type: 'sqlite',
      database: ':memory:',
      entities: [User, Claim, Config, Tenant],
      synchronize: true,
      logging: true,
    }),
    TypeOrmModule.forFeature([User, Config, Tenant]),
    AuthModule,
    UsersModule,
    ClaimsModule,
    ConfigModule,
    TenantsModule,
    GrpcModule,
  ],
})
export class AppModule implements OnModuleInit {
  constructor(
    @InjectRepository(User)
    private readonly userRepository: Repository<User>,
    @InjectRepository(Config)
    private readonly configRepository: Repository<Config>,
    @InjectRepository(Tenant)
    private readonly tenantRepository: Repository<Tenant>
  ) {}

  async onModuleInit() {
    let defaultTenant = await this.tenantRepository.findOne({
      where: { name: 'LIME' },
    });

    if (defaultTenant) {
      console.log('Default tenant (LIME) already exists');
    } else {
      defaultTenant = this.tenantRepository.create({
        name: 'LIME',
        logo: '',
      });
      defaultTenant = await this.tenantRepository.save(defaultTenant);
      console.log('Default tenant (LIME) created successfully!');
    }

    await this.loadConfigurationToDatabase();

    const superAdminEmail = 'lime@example.com';
    const existingSuperAdmin = await this.userRepository.findOne({
      where: { email: superAdminEmail },
    });

    if (existingSuperAdmin) {
      console.log('LIME super admin already exists.');
    } else {
      const hashedPassword = await bcrypt.hash('123456', 10);
      const superAdmin = this.userRepository.create({
        email: superAdminEmail,
        password: hashedPassword,
        name: 'LIME',
        role: UserRole.SUPER_ADMIN,
        tenantId: defaultTenant.id,
      });

      await this.userRepository.save(superAdmin);
      console.log('✓ LIME super admin created.');
      console.log('• Email: lime@example.com');
      console.log('• Password: 123456');
    }
  }

  private async loadConfigurationToDatabase() {
    const configurationPath = path.join(process.cwd(), 'app-config.json');

    try {
      const data = fs.readFileSync(configurationPath, 'utf8');
      const json = JSON.parse(data);

      const defaultTenant = await this.tenantRepository.findOne({
        where: { name: 'LIME' },
      });

      const existingConfiguration = await this.configRepository.findOne({
        where: { tenantId: defaultTenant.id },
      });

      if (existingConfiguration) {
        console.log('Default configuration already exists in database.');
      } else {
        const configuration = this.configRepository.create({
          id: 'dev',
          tenantId: defaultTenant.id,
          data: JSON.stringify(json),
        });

        await this.configRepository.save(configuration);
        console.log('Default configuration loaded from app-config.json.');
      }
    } catch (error) {
      console.error(
        'Oops... error when loading configuration from app-config.json: ',
        error
      );
    }
  }
}
